Este poema satírico fue escrito por Manuel del Palacio (1831-1906), poeta, periodista y satírico español que perteneció al Realismo literario. El poema es un soneto humorístico que juega con las expectativas del lector, describiendo lo que parece ser una situación dramática pero que resulta ser simplemente la aparición de un par de granos.
